import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

declare global {
  interface Window {
    __BANNER_HTML__?: string;
  }
}

const root = ReactDOM.createRoot(document.getElementById('root')!);
root.render(
  <React.StrictMode>
    <App html={window.__BANNER_HTML__ || ''} />
  </React.StrictMode>
);
